__doc__="""
Report a list of possible revelant kerning pair missing for selected Master in Sample Strings array.
It use data from https://github.com/andre-fuchs/kerning-pairs/blob/master/result/relevant_kerning_raw.json by André Fuchs (@andre-fuchs)
"""

font = Glyphs.font

currentMasterID = font.selectedFontMaster.id
masterKerning = font.kerning[currentMasterID]

allKerningPairs = []
for leftSide in masterKerning.keys():
	
	LeftKerningGroup = leftSide if leftSide[0] == "@" else None
	LeftKerningGroupGlyphs = []
	if LeftKerningGroup:
		for glyph in font.glyphs:
			if glyph.rightKerningKey == LeftKerningGroup:
				glyphName = glyph.string if glyph.string else glyph.name
				LeftKerningGroupGlyphs.append(glyphName)
	else:	
		LeftKerningGroupGlyphs.append(font.glyphForId_(leftSide).string)
	
	for rightSide in masterKerning[leftSide].keys():
		RightKerningGroupGlyphs = []
		RightKerningGroup = rightSide if rightSide[0] == "@" else None
		if RightKerningGroup:
			for glyph in font.glyphs:
				if glyph.leftKerningKey == RightKerningGroup:
					glyphName = glyph.string if glyph.string else glyph.name
					RightKerningGroupGlyphs.append(glyphName)
		else:	
			RightKerningGroupGlyphs.append(font.glyphForId_(rightSide).string)
		for g in LeftKerningGroupGlyphs:
			for G in RightKerningGroupGlyphs:
				allKerningPairs.append(g+G)


